ipDict = {}
def getSectionsFast(course):
        
    #start a new web scraping session
    s = requests.session()

    #begin composing the url
    semesterID = "202401"
    url = "https://app.testudo.umd.edu/soc/search?courseId=" + course + "&sectionId=&termId=202401&_openSectionsOnly=on&creditCompare=&credits=&courseLevelFilter=ALL&instructor=&_facetoface=on&_blended=on&_online=on&courseStartCompare=&courseStartHour=&courseStartMin=&courseStartAM=&courseEndHour=&courseEndMin=&courseEndAM=&teachingCenter=ALL&_classDay1=on&_classDay2=on&_classDay3=on&_classDay4=on&_classDay5=on"
    
    
    print(url)

    html = s.get(url).text
    #If course+[X] is in the html, then dont parse after the line it is found
    endings = ['H','X','A','S',"C"]
    for ending in endings:
        if course+ending in html:
            html = html.split(course+ending,1)[0]
    
    #parse the html with bs4
    courses = BeautifulSoup(html,"html.parser").find_all("div", {"class":"section"})




    #make an empty list to contain all sections

    #loop through every section in the course list
    
    sections = []
    for course in courses:

        sections.append(course.find("span", {"class":"section-id"}).text.strip())
    return sections
def clear_dict_at_midnight():
    while True:
        now = datetime.now()
        midnight = datetime(now.year, now.month, now.day + 1, 0, 0, 0)

        # Calculate the time until midnight
        time_until_midnight = (midnight - now).total_seconds()
        # Sleep until midnight
        time.sleep(time_until_midnight)

        # Clear the dictionary at midnight
        ipDict.clear()
        print("Dictionary cleared at midnight")

# Create a thread that runs the function in the background
background_thread = threading.Thread(target=clear_dict_at_midnight)

# Set the thread as a daemon so that it will exit when the main program exits
background_thread.daemon = True

# Start the background thread
background_thread.start()




@ui.page('/unsubscribe/{id}')
def unsubscribe(id):
    #Remove record from database with primary key equal to the id
    conn = psycopg2.connect(connection_string)
    cursor = conn.cursor()
    cursor.execute("DELETE FROM coursedata WHERE uuid = %s", (id,))
    conn.commit()
    conn.close()
    dark = ui.dark_mode()
    dark.enable()

    ui.label("You have been unsubscribed from this course!").style("fontsize:40px")



